function insertParam(key, value, search)
{
    key = encodeURI(key); value = encodeURI(value);

    search = search.toString();

    if(search=='')
        search = document.location.search;

    if(search[0]=="?")
        search = search.substr(1);

    var kvp = [];
    if(search.search("&")==-1 && search!='')
        kvp = [search];
    else if(search=='')
        kvp = [];
    else
        kvp = search.split('&');

    var i=kvp.length;
    var x;

    while(i--)
    {
        x = kvp[i].split('=');

        if (x[0]==key)
        {
            x[1] = value;
            kvp[i] = x.join('=');
            break;
        }
    }

    if(i<0) {kvp[kvp.length] = [key,value].join('=');}

    return kvp.join('&');

}

function getDatePeriod( dates ){
    var date1 = moment(dates[0]).format('Y-MM-DD').split('-');
    var date2 = moment(dates[1]).format('Y-MM-DD').split('-');
    var curDate = moment().format('Y-MM-DD').split('-');
    var str = '';

    var yearDiffers = false;
    var monthDiffers = false;
    var daysDiffers = false;

    if(date1[0] !== date2[0]){
        yearDiffers = true;
    }

    if(date1[1] !== date2[1]){
        monthDiffers = true;
    }

    if(date1[2] !== date2[2]){
        daysDiffers = true;
    }

    if(yearDiffers){
        str = date1[2]+' '+getMonth(date1[1])+' '+date1[0]+' - '+date2[2]+' '+getMonth(date2[1])+' '+date2[0];
        return str;
    } else {
        if(curDate[0] !== date1[0]){
            str = date1[0];
        }
    }

    if(monthDiffers){
        str = date1[2]+' '+getMonth(date1[1])+' - '+date2[2]+' '+getMonth(date2[1])+' '+str;
        return str;
    } else {
        str = getMonth(date1[1])+' '+str;
    }

    if(daysDiffers){
        str = date1[2]+' - '+date2[2]+' '+str;
        return str;
    } else {
        str = date1[2]+' '+str;
        return str;
    }

}

function getMonth( mm ){
    var months = calendar_locale[$('html').attr('lang')]['months'];

    return months[mm];
}
