$(function(){
    initCalendarParams();
});

function initCalendarParams(){

    currentDate =[
        new Date(),
        new Date()
    ];
    if(typeof f5dates !== 'undefined'){
        currentDate = [
            new Date(moment(f5dates.DATE1).format()),
            new Date(moment(f5dates.DATE2).format())
        ];
    }
    /**
     * ,      
     * @type {{selectedDates: {date: boolean, formatted_date: boolean}, calendars: boolean}}
     */
    datesObj = {
        selectedDates: {
            date: currentDate,                //      Date
            formatted_date: false,      //    
        },
        calendars: false
    };
}

/**
 *     
 * @param params
 */
function initCalendar(params) {
    pickmeup('.filters-calendar', params);
    datesObj.calendars = params.calendars; //   ,      
}

/**
 *  
 */
function destroyCalendar() {
    pickmeup('.filters-calendar').destroy();
}

/**
 *    pickmeup-change     
 * @param params
 */
function saveSelectedDates(params) {
    datesObj.selectedDates.date = params.detail.date;
    if(typeof params.detail.notPeriod === 'undefined'){
        $('.filter-date.filters-main-button_selected').removeClass('filters-main-button_selected');
        $('.filter-date[data-id=date]').addClass('filters-main-button_selected');
        $('.filter-date[data-id=date] .filters-main-button__text').html(getDatePeriod(params.detail.date));
    } else {
        $('.filter-date[data-id=date] .filters-main-button__text').html(calendar_locale[$('html').attr('lang')]['select_date']);
    }
}

function pmuRender(date){
    if(typeof f5DatesToHighlight !== 'undefined'){
        var now = new Date();

        if(f5DatesToHighlight.indexOf(moment(date).format("DD.MM.Y")) !=-1){
            return {class_name:'pmu-has_event'};
        }
    }
}

function calendarSetDate( dates ){
    pickmeup('.filters-calendar').set_date(dates);
    var ev = document.createEvent('Event');
    ev.detail = {};
    ev.detail.date = dates;
    ev.detail.notPeriod = true;
    ev.initEvent('pickmeup-change', false, true);
    $('.filters-calendar')[0].dispatchEvent(ev);
}
